/* eslint-disable no-restricted-imports */
import React from "react";
import {
  BottomNavigation,
  BottomNavigationAction,
  Icon
} from "@material-ui/core";
import {makeStyles} from "@material-ui/core/styles";
import RestoreIcon from "@material-ui/icons/Restore";
import FavoriteIcon from "@material-ui/icons/Favorite";
import LocationOnIcon from "@material-ui/icons/LocationOn";
import {Notice, KTCodeExample} from "../../../../_metronic/_partials/controls";

// Example 1
const useStyles = makeStyles({
  root: {
    width: 500
  }
});

// Example 2
const useStyles2 = makeStyles({
  root: {
    width: 500
  }
});

export default function BottomNavigationExamplesPage() {
  // Example 1
  const classes = useStyles();
  const [value, setValue] = React.useState(0);

  // Example 2
  const classes2 = useStyles2();
  const [value2, setValue2] = React.useState("recents");

  function handleChange2(event, newValue) {
    setValue2(newValue);
  }

  return (
    <>
      <Notice icon="flaticon-warning font-primary">
        <span>
          Bottom navigation bars allow movement between primary destinations in
          an app
        </span>{" "}
        <span>
          For more info please check the components's official{" "}
          <a
            target="_blank"
            className="font-weight-bold"
            rel="noopener noreferrer"
            href="https://material-ui.com/components/bottom-navigation/"
          >
            demos & documentation
          </a>
        </span>
      </Notice>
      <div className="row">
        <div className="col-md-6">
          <KTCodeExample jsCode={jsCode1} beforeCodeTitle="Bottom Navigation">
            <span>
              When there are only three actions, display both icons and text
              labels at all times.
            </span>
            <div className="separator separator-dashed my-7"></div>
            <BottomNavigation
              value={value}
              onChange={(event, newValue) => {
                setValue(newValue);
              }}
              showLabels
              className={classes.root}
            >
              <BottomNavigationAction label="Recents" icon={<RestoreIcon />} />
              <BottomNavigationAction
                label="Favorites"
                icon={<FavoriteIcon />}
              />
              <BottomNavigationAction
                label="Nearby"
                icon={<LocationOnIcon />}
              />
            </BottomNavigation>
          </KTCodeExample>
        </div>
        <div className="col-md-6">
          <KTCodeExample
            jsCode={jsCode2}
            beforeCodeTitle="Bottom Navigation with no label"
          >
            <span>
              If there are four or five actions, display inactive views as icons
              only.
            </span>
            <div className="separator separator-dashed my-7"></div>
            <BottomNavigation
              value={value2}
              onChange={handleChange2}
              className={classes2.root}
            >
              <BottomNavigationAction
                label="Recents"
                value="recents"
                icon={<RestoreIcon />}
              />
              <BottomNavigationAction
                label="Favorites"
                value="favorites"
                icon={<FavoriteIcon />}
              />
              <BottomNavigationAction
                label="Nearby"
                value="nearby"
                icon={<LocationOnIcon />}
              />
              <BottomNavigationAction
                label="Folder"
                value="folder"
                icon={<Icon>folder</Icon>}
              />
            </BottomNavigation>
          </KTCodeExample>
        </div>
      </div>
    </>
  );
}

